{'rating': 4.9, 'placeId': 'ChIJiz7wfFtNHRURe1LrDmF9ZWw', 'reviews': [{'text': 'I thought I destroyed an expensive pair of Lindberg progressive glasses. Took them to King Optic and had them ready to wear in minutes! And did not charge me. They get my business from now on!', 'rating': 5, 'language': 'en', 'photoUri': 'https://lh3.googleusercontent.com/a-/ALV-UjWZRaVdNZZJ8ovcaNnKXf0uxrdAWLvRhZ7i8leXtNATpgY=s128-c0x00000000-cc-rp-mo', 'authorName': 'Doug Liebman', 'publishTime': '2023-02-19T14:02:02.000Z'}, {'text': 'I can absolutely recommend it. There is a really good care, perfect and fast service on a very high level and very helpful approach. Much appreciated!', 'rating': 5, 'language': 'en', 'photoUri': 'https://lh3.googleusercontent.com/a-/ALV-UjXwcDN_4jV4WIaOYByUIGkQgr3yDntZY9dTy7Bl4_VVnaFe=s128-c0x00000000-cc-rp-mo-ba4', 'authorName': 'Klára Hlavatá', 'publishTime': '2022-05-31T19:13:43.000Z'}, {'text': 'Great experience and very professional! I got my prescription done here for both contact lenses and eye glasses - the equipment was very modern and high-tech, and the optometrist was very helpful and knowledgeable with the latest lens technologies.

Amazing selection of top brands for both glasses frames, sunglasses, and contact lenses. Thanks again for all the help!', 'rating': 5, 'language': 'en', 'photoUri': 'https://lh3.googleusercontent.com/a-/ALV-UjVcHKc0zCcFHQwoac5PNQrvYew9glXp7Kq5uYjVvqf7Uy0=s128-c0x00000000-cc-rp-mo-ba3', 'authorName': 'Or Reznichky', 'publishTime': '2018-01-19T23:29:27.000Z'}, {'text': 'Great service. Coming from Canada. Walked-in and they fixed glasses on the spot at no charge. Glasses had lost a screw and lense fell. They added a screw and adjusted glasses also.', 'rating': 5, 'language': 'en', 'photoUri': 'https://lh3.googleusercontent.com/a/ACg8ocIcNbzo1FfXjAWXkIEc6oAxyXjhWwGwfJyEp8Eh2FTx=s128-c0x00000000-cc-rp-mo', 'authorName': 'Francois Blais', 'publishTime': '2018-11-06T20:14:45.000Z'}, {'text': 'Itzik is super patient and has great selection', 'rating': 5, 'language': 'en', 'photoUri': 'https://lh3.googleusercontent.com/a-/ALV-UjULFhj4T5ndZr54yskQvDCyyXE91ySLLbYPxEclQ5-oOso=s128-c0x00000000-cc-rp-mo-ba3', 'authorName': 'Yuval Rintzler', 'publishTime': '2023-05-18T11:38:48.000Z'}, {'text': 'צוות מקסים, איציק בחור אדיב שתמיד עוזר מכל הלב', 'rating': 5, 'language': 'he', 'photoUri': 'https://lh3.googleusercontent.com/a/ACg8ocIxBBye2IUZR24pBRWTxvuBgHAgjSIn6fBWriZU3sP3=s128-c0x00000000-cc-rp-mo', 'authorName': 'Reut Yedidim', 'publishTime': '2023-10-02T07:52:24.000Z'}, {'text': 'שירות מצויין. אחראי. מבחר מסגרות מיוחדות ומחירים מאוד נוחים', 'rating': 5, 'language': 'he', 'photoUri': 'https://lh3.googleusercontent.com/a/ACg8ocKrnHQbX9rjZQa8iTvMmDJqjKQArrWphWMDBRp4AnEL=s128-c0x00000000-cc-rp-mo', 'authorName': 'Tal Haver', 'publishTime': '2023-07-13T17:47:07.000Z'}, {'text': 'במשך כל חיי החלפתי המון זוגות של משקפיי ראייה ובכל פעם לא הייתי מרוצה עד שסוף סוף הכרתי את איגור ואיציק מקינג אופטיק שעזרו לי לבחור זוג מיוחד והכינו עדשה דקה שנבלעה במלואה במסגרת. תודה רבה!!', 'rating': 5, 'language': 'he', 'photoUri': 'https://lh3.googleusercontent.com/a-/ALV-UjUlEvcwnmKXi6cwvocAoG9Unny_s1UvWW3