האופטומטריסט הטוב ביותר שהיה לי בקריירה של 50 שנות משקפופריות.', 'rating': 5, 'language': 'he', 'photoUri': 'https://lh3.googleusercontent.com/a/ACg8ocKmE9Li0pwWIFlD7cHlD9KsbkAwkQ3GV7DfdSS97WFh=s128-c0x00000000-cc-rp-mo', 'authorName': 'Itai Agmon', 'publishTime': '2023-04-20T14:12:11.000Z'}, {'text': 'האופטומטריסט הטוב ביותר בעיר! שנים של שרות ומקצועיות מדהימים!', 'rating': 5, 'language': 'he', 'photoUri': 'https://lh3.googleusercontent.com/a-/ALV-UjXhfq4-u5s8ZmmONd7jo19Ziiv6TrzpSBa2_zASJ7O9ig=s128-c0x00000000-cc-rp-mo', 'authorName': 'Inna Glikshtern', 'publishTime': '2023-06-30T06:26:14.000Z'}], 'priceLevel': 'PRICE_LEVEL_UNSPECIFIED', 'dogFriendly': False, 'openingHours': {'friday': '09:30-14:30', 'monday': '09:30-18:30', 'sunday': '09:30-18:30', 'tuesday': '09:30-18:30', 'saturday': 'Closed', 'thursday': '09:30-18:30', 'wednesday': '09:30-18:30'}}
